import React from "react";
import HeaderElement from "./HeaderElement";
import '../styles/headers/Header.css';

const header_elements = [
    {
        id:1,
        name:"Календарь"
    },
    {
        id:2,
        name:"Профиль"
    }
]

function Header() {
    return (
        <div>
            <header>
                <ul className="headerList">
                    <HeaderElement className="headerElement" name="Главная"></HeaderElement>
                    <HeaderElement className="headerElement" name="Календарь"></HeaderElement>
                    <p className="headerElement">Профиль</p>
                    <p className="headerElement">Вход</p>
                    <p className="headerElement">Домены</p>
                    <p className="headerElement">Настройки</p>
                </ul>
            </header>
        </div>
    )
}

export default Header;
